DECLARE @BinaryFileId INT
    , @BinaryFileTypeIdDefault INT = (
        SELECT TOP 1 Id
        FROM [BinaryFileType]
        WHERE [Guid] = 'C1142570-8CD6-4A20-83B1-ACB47C1CD377'
        )
    , @StorageEntityTypeIdDatabase INT = (
        SELECT TOP 1 Id
        FROM [EntityType]
        WHERE [Guid] = '0AA42802-04FD-4AEC-B011-FEB127FC85CD'
        )

-- Add AchievementTrophy.svg
IF NOT EXISTS (
        SELECT *
        FROM [BinaryFile]
        WHERE [Guid] = '9A1503BC-D965-4BD4-AEA4-8039D4657201'
        )
BEGIN
    INSERT INTO [BinaryFile] (
        [IsTemporary]
        , [IsSystem]
        , [BinaryFileTypeId]
        , [FileName]
        , [MimeType]
        , [StorageEntityTypeId]
        , [Guid]
        )
    VALUES (
        0
        , 0
        , @BinaryFileTypeIdDefault
        , 'AchievementTrophy.svg'
        , 'image/svg+xml'
        , @StorageEntityTypeIdDatabase
        , '9A1503BC-D965-4BD4-AEA4-8039D4657201'
        )

    SET @BinaryFileId = SCOPE_IDENTITY()

    INSERT INTO [BinaryFileData] (
        [Id]
        , [Content]
        , [Guid]
        )
    VALUES (
        @BinaryFileId
        , 
        , '6FD74BED-CD94-4ADB-833A-1B42E0FBE172'
        )
END
